import React from 'react';


export default function NavBar(props){

    console.log(window.location.hash + "whart");

    if ( window.location.hash === "#complete"){
        return (
        <div class = "card text">
            <div class="card-header">
                <ul class="nav nav-tabs card-header-tabs">
                    <li class="nav-item">
                        <a class="nav-link active" href="#complete" onClick={()=> window.location.reload(false)} >complete tasks</a>
                    </li>
                    <li class="nav-item">
                        <a class="nav-link" href="#incomplete" onClick={()=> window.location.reload(false)}>incomplete tasks</a>
                    </li>
                </ul>
            </div>
        </div>
        )}

    return (
        <div class = "card text">
            <div class="card-header">
                <ul class="nav nav-tabs card-header-tabs">
                    <li class="nav-item">
                    <a class="nav-link" href="#complete" onClick={()=>window.location.reload()}>complete tasks</a>
                    </li>
                    <li class="nav-item">
                    <a class="nav-link active" href="#incomplete" onClick={()=>window.location.reload()}>incomplete tasks</a>
                    </li>
                </ul>
            </div>
        </div>
    )


}
